import * as S from "./style";
const Header = () => {
  return (
    <S.HeaderWrapper>
      <div
        style={{
          fontSize: "1.8rem",
          fontWeight: "700",
          color: "#e6fb03",
        }}
      >
        TODOLIST
      </div>
    </S.HeaderWrapper>
  );
};
export default Header;
